import '../App.css';


function Stations() {

  const[myData, setData] = useState(0)
  useEffect(()=>{
    fetch('http://127.0.0.1:5000/pollination').then(response =>
       response.json().then(data =>{ setData(data)} ))

  }, [])


  return (
    <div>
           <h1> {myData} </h1>
    </div>
  );
}
export default Stations;
